import React, { Component } from 'react';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-material.css';

class ProcessTable extends Component {
    constructor(props) {
        super(props);
        this.state = {
          columnDefs: [{
            headerName: "Process", field: "process"
          }, {
            headerName: "Status", field: "status"
          }, {
            headerName: "Number of Items", field: "items"
          },{
            headerName: "Info", field: "info"
          }],
          rowData: [{
            process: "1", status: "OK", items: 35000, info: "hello"
          }, {
            process: "2", status: "KO", items: 32000, info: "info"
          }, {
            process: "3", status: "OK", items: 72000, info: "info"
          }]
        }
      }

      render() {
        return (
          <div 
            className="ag-theme-material"
            style={{ 
            height: '500px', 
            width: '600px' ,
            margin: 'auto',
            justifyContent: 'center',
            marginTop: '60px',
            }} 
          >
            <AgGridReact
              columnDefs={this.state.columnDefs}
              rowData={this.state.rowData}>
            </AgGridReact>
          </div>
        );
      }
}

export default ProcessTable;
